window.bookSummaryJSON = "<p>All is not as it seems in Neverland.<br> As for Peter &amp; Hook…<br> I know the secret most don't.</p> <p>The real truth behind the myth.<br> The hidden wonder you've never known disguised as the notorious legend.</p> <p>I know the nightmare that brings Hook to his knees.<br> The inescapable reality<br> Peter Pan one day couldn't fly away from.</p> <p>All you've ever been told is a lie.<br> A hoax.<br> A pixie trick.</p> <p>I know the truth because…<br> I'm their ruin.<br> I'm their demise.<br> I'm the end of what was &amp;<br> the beginning of what's to come.</p> <p>My name is Wendy Moira Angela Darling,<br> &amp; I'm the reason for losing Neverland.</p>"; 
